import "bootstrap/dist/css/bootstrap.css";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/css/sidebars.css";
//import "bootstrap/dist/js/bootstrap.js";
//import "bootstrap/dist/js/bootstrap.min.js"
//import "bootstrap/dist/js/bootstrap.bundle.min.js"
import "bootstrap/dist/js/sidebars.js";
import Vue3Sidebar from 'vue-3-sidebar'

import "jszip"
import "pdfmake"
import "jquery"
import "datatables.net-bs5"

import "datatables.net-autofill-bs5";
import "datatables.net-buttons-bs5"
import "datatables.net-buttons/js/buttons.colVis.js"
import "datatables.net-buttons/js/buttons.html5.js"
import "datatables.net-buttons/js/buttons.print.js"

// Autocomplete Library For Bootstrap 5 – autocompleteBS
import "bootstrap/dist/js/autocompleteBS.js"
import "bootstrap/dist/css/autocompleteBS.css"

// seelect2
import "bootstrap/dist/js/select2/jquery.min.js"
import "bootstrap/dist/js/select2/select2.min.js"
import "bootstrap/dist/css/select2/select2.css"
import "bootstrap/dist/css/select2/select2.min.css"
import "bootstrap/dist/css/select2-bootstrap-5-theme.css"

// jQuery UI Autocomplete
// import "../node_modules/jQueryUI/js/jquery-ui.js"
// import "../node_modules/jQueryUI/css/jquery-ui.css"
// import "../node_modules/jQueryUI/css/jquery-ui.min.css"

//import VueTheMask from "vue-the-mask";

import { FontAwesomeIcon } from "@fortawesome/vue-fontawesome";
/* import the fontawesome core */
import { library } from '@fortawesome/fontawesome-svg-core'
/* import specific icons */
import { faPen } from '@fortawesome/free-solid-svg-icons/faPen'
import { faTrashCan } from '@fortawesome/free-solid-svg-icons/faTrashCan'
import { faPlus } from '@fortawesome/free-solid-svg-icons/faPlus'
import { faBan } from '@fortawesome/free-solid-svg-icons/faBan'
import { faCircleCheck } from '@fortawesome/free-solid-svg-icons/faCircleCheck'
import { faAddressBook } from '@fortawesome/free-solid-svg-icons/faAddressBook'
import { faUserPlus } from '@fortawesome/free-solid-svg-icons/faUserPlus'
import { faUserPen } from '@fortawesome/free-solid-svg-icons/faUserPen'
import { faSignOut } from '@fortawesome/free-solid-svg-icons/faSignOut'
import { faFolderOpen } from "@fortawesome/free-regular-svg-icons/faFolderOpen"
import { faCheckToSlot } from "@fortawesome/free-solid-svg-icons/faCheckToSlot"
import { faCartPlus } from "@fortawesome/free-solid-svg-icons/faCartPlus"
import { faFileXmark } from "@fortawesome/free-solid-svg-icons/faFileCircleXmark"
/* add icons to the library */
library.add(
    faPen, faTrashCan, faPlus, faCircleCheck, faBan, 
    faAddressBook, faUserPlus, faUserPen, faSignOut, 
    faFolderOpen, faCheckToSlot, faCartPlus, faFileXmark
)

// DatePicker
import Datepicker from "@vuepic/vue-datepicker"
import "@vuepic/vue-datepicker/dist/main.css"

import { createApp } from "vue";
import App from "./App.vue";
import './registerServiceWorker'
import router from "./router";
import Loading from "vue-loading-overlay";
import "vue-loading-overlay/dist/vue-loading.css"

// vue3-autocomplete
// import Autocomplete from "vue3-autocomplete"
// import "vue3-autocomplete/dist/vue3-autocomplete.css"
// const app = createApp(App)
// app.component("Autocomplete", Autocomplete),

// PrimeVue ???
// import PrimeVue from 'primevue/config';
// import Button from 'primevue/button';
// import Autocomplete from "primevue/autocomplete"
// import Calendar from 'primevue/calendar';

createApp(App).
use(router).
use(Vue3Sidebar).
component("font-awesome-icon", FontAwesomeIcon).
component("Loading", Loading).
component("Datepicker", Datepicker).
mount("#app");
